//SPDX-License-Identifier: MIT 

pragma solidity ^0.8.0;

contract Event {
    event Log(string message, uint val);

    event IndexedLog(address indexed sender, uint val);

    function example() external {
        emit Log("Foo", 1234);
    }
}

